import React, { Component } from "react";

export class SignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: ""
    };
  }

  updateEmailField = e => {
    this.setState({ email: e.target.value });
  };

  render() {
    return (
      <div>
        <h1>test@test.com</h1>
        <input
          type="email"
          name="email"
          value="value"
          onChange={this.updateEmailField}
        />
        <p>{this.state.email}</p>
      </div>
    );
  }
}

export default SignUp;
